define([
  'models/base/collection',
  './user-post-model'
], function(Collection, UserPostModel) {
  'use strict';

  var UserPost = Collection.extend({
    url:function() {
    	var str=location.hash.substring(2);
    	return config.apiUrl + str+"/wall"
    },
    model: UserPostModel
  });

  return UserPost;
});